import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

class StockComp extends React.Component {
    constructor(props) {
        super(props)
        this.state = {
            name: this.props.list.name,
            price: this.props.list.price
        }
    }

    render() {
        return 1
    }
}


export default StockComp;
